import React, { useState, useEffect } from 'react'
import HouseDetail from './HouseDetail'
import { useNavigate, useParams } from "react-router-dom";


function RenderHouse({houseToDisplay, onDelete, setHouseToDisplay}) {

    const { id } = useParams();
    let navigate = useNavigate();


    useEffect(() => {
        fetch(`/houses/${houseToDisplay.id}`)
        .then(res => res.json())
        .then(data => setHouseToDisplay(data))
    }, [])

    function clickToRender() {
        // e.preventDefault();
        console.log('You clicked the house', houseToDisplay);
        // dynamically navigate to houseDetail
        setHouseToDisplay(houseToDisplay)
        navigate(`/houses/${houseToDisplay.id}`, houseToDisplay);
    }

    let house_images = [
        "https://cdn.vox-cdn.com/thumbor/frFQQhOsxl8DctGjkR8OLHpdKMs=/0x0:3686x2073/1200x800/filters:focal(1549x743:2137x1331)/cdn.vox-cdn.com/uploads/chorus_image/image/68976842/House_Tour_Liverman_3D6A3138_tour.0.jpg",
        "https://www.peoplenewspapers.com/wp-content/uploads/2019/08/632-miller-ave-dallas-tx-2-High-Res-2-800x445.jpg",
        "https://www.google.com/imgres?imgurl=https%3A%2F%2Fthumbs.dreamstime.com%2Fb%2Fbrick-hosue-8-1342100.jpg&imgrefurl=https%3A%2F%2Fwww.dreamstime.com%2Fphotos-images%2Fbrick-hosue.html&tbnid=PXQT0CFV5q_oXM&vet=10CA0QxiAoCGoXChMIqI250_vO9wIVAAAAAB0AAAAAEBE..i&docid=Qac2Bu8VfynmnM&w=800&h=522&itg=1&q=house%20images&ved=0CA0QxiAoCGoXChMIqI250_vO9wIVAAAAAB0AAAAAEBE",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcScBerO6QbC1QzVADNM21seQfBZBngHHnXJpBN-jJHUWXFgfCvKt5muiBSKve9uwrJpsFU&usqp=CAU",
        "https://images.unsplash.com/photo-1580587771525-78b9dba3b914?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8bHV4dXJ5JTIwaG91c2V8ZW58MHx8MHx8&w=1000&q=80",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ6VRVMJrRl5CGkFUo7OMXHVlxIEyOcc6hT7Bok3A8aq05a6GfMsJj5WKyYpMc5F8GMzvQ&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQjcVAmqmg8vvBKEwn4QTYr2GafkcqJzVPQSHHu4wta9AO3GBCKf8Ed614vBIqRKxPlrPA&usqp=CAU",
        "https://cdn.vox-cdn.com/thumbor/FrnLQTpuAoAmp0GZRZctSSdkC04=/0x0:3000x2000/1200x0/filters:focal(0x0:3000x2000):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/21905363/iStock_185930591.jpg"
    ]

    return (
    <div id="outer">
        <div id="container" class="w-80 relative p-3 col-start-1 row-start-1 flex flex-col-reverse rounded-lg bg-gradient-to-t from-black/75 via-black/0 sm:bg-none sm:row-start-2 sm:p-0 lg:row-start-1">
            <div id="card" 
            class=" relative p-3 col-start-1 row-start-1 flex flex-col-reverse rounded-lg bg-gradient-to-t from-black/75 via-black/0 sm:bg-none sm:row-start-2 sm:p-0 lg:row-start-1" 
            onClick={() => clickToRender()}>
                <h4>Lot Size: {houseToDisplay.lotSizeAcres}</h4>
                <h4>Bathroom: {houseToDisplay.bathroomsTotal}</h4>
                <h4>Bedroom: {houseToDisplay.bedroomsTotal}</h4>
                <h4>List Price: ${houseToDisplay.listPrice}</h4>
                <h1 class="font-semibold pb-2">{houseToDisplay.city} {houseToDisplay.state} {houseToDisplay.postcde}</h1>
                <h1 class="font-semibold pt-2">{houseToDisplay.street}</h1>
                <div class="">
                    <img class="w-full h-60 object-cover rounded-lg" src={house_images.sample}></img>
                    {/* <img src="https://images.adsttc.com/media/images/5ecd/d4ac/b357/65c6/7300/009d/large_jpg/02C.jpg?1590547607" alt="house" 
                    class="w-full h-60 object-cover rounded-lg ">
                    </img> */}
                </div>
                {/* <button class="float-left outline-yellow-400 material-icons" onClick={()=>onWatch(houseToDisplay)} > favorite_border</button> */}
                <button class="float-left outline-yellow-400 material-icons"> favorite_border</button>
                <div>
                </div>
            </div>
        </div>
    </div>
  )
}

export default RenderHouse
